  false,\n\t\"url\": null,\n\t\"notes\": \"Investigation involved the surveillance
  for ranavirus in 6 freshwater turtles species at Wapanocca NWR, Turrell, Arkansas
  and potential influences associated with agricultural pesticides in the aquatic
  system.  No turtles were detected with ranavirus based on qPCR tesing.  Pesticide
  residues detected included herbicide, fungicide and insecticides including products
  presumably applied off the refuge (e.g., atrazine) but which entered the refuge
  through common agricultural drainages.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
